pragma solidity ^0.8.9;

import "./Factory.sol";

contract Main {
    Factory factory;
    address public factoryAddress;

    constructor() {
        factory = new Factory();
    }

    function getFactoryAddress() public view returns (address) {
        return address(factory);
    }
}
